import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

export default function HOOKS() {

  const [name,setName] = useState('');
  const [email,setEmail] = useState('');
  const [password,setPassword] = useState('');

const nameChange = (e) =>{
    setName(e.target.value);
}
const emailChange = (e) =>{
    setEmail(e.target.value);
}
const passwordChange = (e) =>{
  setPassword(e.target.value);
}

const formHandler = (e) =>{
 console.log(name, email, password);
 e.preventDefault();
}
  return (
     <div>
      <div className='row'>
      <div className='col-md-6 offset-3 p-3'>
      <Form action=""  onSubmit={formHandler} >
      <Form.Group className="mb-3" controlId="formBasicEmail">
      <Form.Label>Name</Form.Label>
      <Form.Control type="text" value={name}  placeholder="Enter name" required onChange={nameChange} />
    </Form.Group>
    <Form.Group className="mb-3" controlId="formBasicEmail">
      <Form.Label>Email address</Form.Label>
      <Form.Control type="email"  value={email}  placeholder="Enter email" required onChange={emailChange} />
    </Form.Group>

    <Form.Group className="mb-3" controlId="formBasicPassword">
      <Form.Label>Password</Form.Label>
      <Form.Control type="password"  value={password}  placeholder="Password" required  onChange={passwordChange} />
    </Form.Group>
    <Button variant="primary" type="submit">
      Register
    </Button>
  </Form>
        </div>
      </div>
     </div>

  )
}
